export const getProductByBarcode = async (barcode) => {
        return result = await fetch("db/products.json")
        .then(response => response.json())
        .then(data => {
            const product = data.find((product)=> product.barcode === barcode);
            return product;
        })
        .catch(err => {
            console.error(Error(err))
            return null;
        });

        return result;
};
